import React from 'react'
import 'materialize-css'
import { useRoutes } from './routes'
import {BrowserRouter as Router} from 'react-router-dom'


function App() {
  const routes = useRoutes(false)
  return (
    <Router>
    <div className="container">
    {routes}
    <h1>Hello</h1>
    </div>
    </Router>
  )
}

export default App
